import React, { useState, useEffect } from 'react';
import { updateUserProfile, getUserProfile } from '../../services/api';
import { useNavigate } from 'react-router-dom';
import './ProfilePage.css'

const ProfilePage = () => {
  const navigate = useNavigate();
  const [profile, setProfile] = useState({
    fullName: '',
    email: '',
    education: '',
    skills: '',
    experience: '',
    careerGoals: '',
    resume: null, // file input
  });
  const [message, setMessage] = useState('');

  // Fetch existing profile data when the component mounts (if available)
  useEffect(() => {
    const fetchProfile = async () => {
      try {
        const data = await getUserProfile(); // API call to fetch profile
        if (data) {
          setProfile({
            fullName: data.fullName || '',
            email: data.email || '',
            education: data.education || '',
            skills: data.skills || '',
            experience: data.experience || '',
            careerGoals: data.careerGoals || '',
            resume: null,
          });
        }
      } catch (error) {
        console.error('Error fetching profile:', error);
      }
    };

    fetchProfile();
  }, []);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setProfile((prev) => ({
      ...prev,
      [name]: value,
    }));
  };

  const handleFileChange = (e) => {
    const file = e.target.files[0];
    setProfile((prev) => ({
      ...prev,
      resume: file,
    }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      // Prepare form data for file upload
      const formData = new FormData();
      formData.append('fullName', profile.fullName);
      formData.append('email', profile.email);
      formData.append('education', profile.education);
      formData.append('skills', profile.skills);
      formData.append('experience', profile.experience);
      formData.append('careerGoals', profile.careerGoals);
      if (profile.resume) {
        formData.append('resume', profile.resume);
      }

      await updateUserProfile(formData);
      setMessage('Profile updated successfully!');
      // Optionally redirect or perform other actions
      // navigate('/'); // e.g., redirect to home page after saving profile
    } catch (error) {
      console.error('Error updating profile:', error);
      setMessage('Error updating profile');
    }
  };

  return (
    <div className="profile-container container">
      <h2>Build Your Job Profile</h2>
      <form onSubmit={handleSubmit} encType="multipart/form-data" className="profile-form">
        <div>
          <label>Full Name</label>
          <input
            type="text"
            name="fullName"
            value={profile.fullName}
            onChange={handleChange}
            placeholder="Your full name"
            required
          />
        </div>
        <div>
          <label>Email</label>
          <input
            type="email"
            name="email"
            value={profile.email}
            onChange={handleChange}
            placeholder="Your email"
            required
          />
        </div>
        <div>
          <label>Education</label>
          <input
            type="text"
            name="education"
            value={profile.education}
            onChange={handleChange}
            placeholder="Your highest qualification"
          />
        </div>
        <div>
          <label>Skills</label>
          <input
            type="text"
            name="skills"
            value={profile.skills}
            onChange={handleChange}
            placeholder="List your skills, separated by commas"
          />
        </div>
        <div>
          <label>Work Experience</label>
          <textarea
            name="experience"
            value={profile.experience}
            onChange={handleChange}
            placeholder="Describe your work experience"
          ></textarea>
        </div>
        <div>
          <label>Career Goals</label>
          <textarea
            name="careerGoals"
            value={profile.careerGoals}
            onChange={handleChange}
            placeholder="Describe your career goals"
          ></textarea>
        </div>
        <div>
          <label>Upload Resume</label>
          <input type="file" name="resume" onChange={handleFileChange} />
        </div>
        <button type="submit" className="btn btn-primary">Save Profile</button>
      </form>
      {message && <p className="message">{message}</p>}
    </div>
  );
};

export default ProfilePage;
